webpackJsonp([0x78fb970f8e8e],{1484:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2005-09-20-study-what-you-like-cause-it-will-come-back-to-haunt-you/index.md absPath of file >>> MarkdownRemark",html:"<p>One frequent conversation amongst engineers entails the bragging of how\nhard their undergrad education was.  This is usually measured by\ntwo factors:</p>\n<ol>\n<li>\n<p>How poorly the class performed overall</p>\n</li>\n<li>\n<p>How late one stayed in the computer labs.</p>\n</li>\n</ol>\n<p>My dad always told me that your educational experience would reflect\nthe job environment in the real world.  It's almost 11 pm\nnow.  We are still working.  I am sitting in a \"lab\" in a\nbuilding on campus.  As I look out the window I see students in\nvarious states of exhaustion.  I remember my days in the labs, the\ndays I use for bragging rights, and I have to laugh at dad's\nprophecy.  My education and my job match almost perfectly. \nThe only difference is that the lab has shifted a couple hundred yards\nto the northwest from the engineering to the education building. \neduCommons 1.5.2 is almost ready.  Really dear, I will be home\nsoon.</p>",frontmatter:{title:"study what you like cause it will come back to haunt you.",date:"September 20, 2005",imageUrl:null,image:null}}},pathContext:{path:"/study-what-you-like-cause-it-will-come-back-to-haunt-you"}}}});
